# Memory Usage: 17.2 MB, less than 39.79% of Python3 online submissions for Most Profit Assigning Work.
# https://leetcode.com/problems/most-profit-assigning-work/solution/
class Solution:
    def maxProfitAssignment(self, difficulty: List[int], profit: List[int], worker: List[int]) -> int:
        tasks = list(zip(difficulty, profit))
        tasks.sort()
        profit = 0
        worker.sort()
        i, best = 0, 0
        for w in worker:
            while i < len(tasks) and w >= tasks[i][0]:
                best = max(best, tasks[i][1])
                i += 1
            profit += best
        return profit


